import React from "react";

function Footer() {
  return (
    <div class="container">
      <footer class="py-3 my-4">
        <p class="text-center text-muted bg-dark ftp1">&copy; 2022 Company, Inc</p>
      </footer>
    </div>
  );
}
export default Footer;
